import React from "react";

const Services = () => {
    return(
        <div> 
            <section id="service">
                <div className="container">
                    <div className="row">
                        <div className="col-12">
                            <h3 className="fs-5">Our Services</h3>
                            <h1 className="display-6">Our <b>Awesome</b>Services</h1>
                        </div>
                    </div>
                </div>
            </section>
        </div>
        );
    }
    
    export default Services;
